import React from "react";

const FAQ = () => {
  return (
    <div className="faq-section">
      <h2>Frequently Asked Questions</h2>

      <h3>How to download Instagram videos and photos?</h3>
      <p>Paste the Instagram post, reel, or IGTV URL in the Instagram tab and click Download.</p>

      <h3>How to download WhatsApp DP?</h3>
      <p>Enter the WhatsApp number with country code (e.g. 919876543210) in the WhatsApp tab and click Fetch DP.</p>

      <h3>Can I download YouTube shorts and videos?</h3>
      <p>Yes, paste any YouTube video or shorts URL in the YouTube tab and click Download.</p>

      <h3>Is this service free?</h3>
      <p>Yes, it is completely free to use.</p>

      <h3>Do I need to login?</h3>
      <p>No login required. Just paste the URLs or numbers and download.</p>
    </div>
  );
};

export default FAQ;
